import React from 'react';
const UserSearchResults = ({ users }) => {
    console.log(users)
    return (
      <div className="user-search-results">
        {users?.map(user => (
            <>
            <div key={user.id} className="user-search-result">
                <img src={user.img} alt={user.username} />
                <p>{user.username}</p>
            </div>
            </>


        ))}
      </div>
    );
  };

export default UserSearchResults;
